import{_ as e,o as t,c as a,O as n}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 63.2-1940.1 Publishing a most wanted delinquent parent list; coordinated arrests.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/63.2-1940.1.md","filePath":"vacode/63.2-1940.1.md"}'),i={name:"vacode/63.2-1940.1.md"},r=n('<h1 id="§-63-2-1940-1-publishing-a-most-wanted-delinquent-parent-list-coordinated-arrests" tabindex="-1">§ 63.2-1940.1 Publishing a most wanted delinquent parent list; coordinated arrests. <a class="header-anchor" href="#§-63-2-1940-1-publishing-a-most-wanted-delinquent-parent-list-coordinated-arrests" aria-label="Permalink to &quot;§ 63.2-1940.1 Publishing a most wanted delinquent parent list; coordinated arrests.&quot;">​</a></h1><p>The Division of Child Support Enforcement shall (i) publish at regular intervals a list of the most wanted delinquent parents as determined by the Commissioner together with arrearage information and other identifying information, including but not limited to, a photograph, occupation and last known address for the purpose of locating such delinquent parents and (ii) periodically conduct coordinated arrests of delinquent parents in conjunction with state and local criminal justice agencies pursuant to § <a href="http://law.lis.virginia.gov/vacode/16.1-278.16/" target="_blank" rel="noreferrer">16.1-278.16</a>.</p><p>2003, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0929" target="_blank" rel="noreferrer">929</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0942" target="_blank" rel="noreferrer">942</a>.</p>',3),o=[r];function s(l,d,c,p,h,u){return t(),a("div",null,o)}const f=e(i,[["render",s]]);export{g as __pageData,f as default};
